using ChatService.Shared.Models;
using ChatService.Shared.Models.Messages;
using System;
using System.Collections.Generic;
using System.Collections.ObjectModel;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace ChatService.Client.Data
{
    /// <summary>
    /// Dient zum 
    /// </summary>
    public class DataContext
    {
        public User Iam { get; set; } = new User();
        public List<Contact> MyContacts { get; set; } = new List<Contact>();
        public List<Conversation> Conversations { get; set; } = new List<Conversation>();

        #region Instance
        private static DataContext instance = null;
        private static readonly object padlock = new object();
        public static DataContext Instance
        {
            get
            {
                if (instance == null)
                {
                    lock (padlock)
                    {
                        if (instance == null)
                        {
                            instance = new DataContext();
                        }
                    }
                }

                return instance;

            }
        }
        #endregion

        public static string fileBase64 = "";


        private DataContext()
        {
            User Hans = new User { UserGuid = "146f61f1-6dd0-471f-a8ed-264be2293630",  Nickname = "Hans User1" };
            User Peter = new User { UserGuid = "195471a1-459a-4b26-9d10-14a885e50cba", Nickname = "Peter User2" };
            User Moritz = new User { UserGuid = "1537974b-283b-44fa-8d2d-2e80ba4fc245", Nickname = "Moritz User3" };
            User Linda = new User { UserGuid = "c86f038a-896e-432f-9e8d-d3ecf3a9aae2", Nickname = "Linda User4" };

            Message messageFromHans = new Message { From =Hans, Content =  new MessageContent("Hey wie geht es. grüße Hans.") , DateTime = DateTime.Parse("16.12.2019 08:24:00")/*, FromGuid = "1", ToGuid = "123", MessageGuid = "1-1" */};
            Message messageFromHans2 = new Message { From = Hans, Content = new MessageContent { ContentString = fileBase64, FileName = "Bild.jpeg", ContentTyp = MessageContentTyp.Image}, DateTime = DateTime.Parse("06.06.2019 08:24:00")/*, FromGuid = "1", ToGuid = "123", MessageGuid = "1-1" */};


            Message messageFromPeter = new Message { From = Peter, Content = new MessageContent("Hey wie geht es. grüße Peter.") , DateTime = DateTime.Parse("16.12.2019 10:20:00")/*, FromGuid = "2", ToGuid = "123", MessageGuid = "2-1"*/ };
            Message messageFromMoritz = new Message { From = Moritz, Content =  new MessageContent("Hey wie geht es. grüße Moritz.") , DateTime = DateTime.Parse("16.12.2019 11:17:00")/*, FromGuid = "3", ToGuid = "123", MessageGuid = "3-1"*/};
            Message messageFromLinda = new Message { From = Linda, Content =  new MessageContent("Hey wie geht es. grüße Linda.") , DateTime = DateTime.Parse("15.12.2019 10:00:00")/*, FromGuid = "4", ToGuid = "123", MessageGuid = "4-1"*/ };

            List<Message> messagesFromHans = new List<Message>
            {
                messageFromHans,
                messageFromHans2
            };

            List<Message> messagesFromPeter = new List<Message>
            {
                messageFromPeter
            };

            List<Message> messagesFromMoritz = new List<Message>
            {
                messageFromMoritz
            };
            List<Message> messagesFromLinda = new List<Message>
            {
                messageFromLinda
            };

            Conversations.Add(new Conversation { From = Hans, Messages = new ObservableCollection<Message>(messagesFromHans) });
            Conversations.Add(new Conversation { From = Peter, Messages = new ObservableCollection<Message>(messagesFromPeter) });
            Conversations.Add(new Conversation { From = Moritz, Messages = new ObservableCollection<Message>(messagesFromMoritz) });
            Conversations.Add(new Conversation { From = Linda, Messages = new ObservableCollection<Message>(messagesFromLinda) });
        }
    }
}
